import React, { Component } from 'react';
import DropDown from '../components/DropDown';
import Data from '../components/Data';

export default class Home extends Component{
	handleFilter = (value) => {
		console.log(value);
	}
	render(){
		return(
			<React.Fragment>
				<DropDown handleChange = {this.handleFilter}/>
				<Data />
			</React.Fragment>
		)
	}
}
